import React, { Component } from 'react';
import {Button, Dialog, TextInput} from 'evergreen-ui';

class MaterialThickness extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isShown: false,
      value: "set material thickness",
    }
  }

  render() {
    return (
      <div>
        <Dialog
          isShown={this.state.isShown}
          title="Material Thickness"
          onCloseComplete={() => this.setState({isShown:false})}
          onConfirm={() => {
            console.log("updating material thickness to ", this.state.value);
            this.setState({isShown:false});
          }}>

          <TextInput
            onChange={e => this.setState({ value: e.target.value })}
            placeholder={this.state.value}
          />
        </Dialog>
        <Button onClick={() => this.setState({isShown:true})}> Material Thickness</Button>
      </div>
    );
  }
}

export {MaterialThickness};
